import React from "react";
import { Link } from "react-router-dom";
import About from "../pages/About";
import Home from "../pages/Home";
import Login from "../pages/Login";
import Register from "../pages/Register";

const Layout = () => {
  return (
    <div>
      <Link to={<Home />} />
      <Link to={<About />} />
      <Link to={<Register />} />
      <Link to={<Login />} />
    </div>
  );
};

export default Layout;
